  assign wc_fifo_7$EN_portAClear = 1'b0 ;
  assign wc_fifo_7$EN_portBClear = 1'b0 ;

  // remaining internal signals
  assign wc_fifo_1_RDY_portA_request_put_AND_wc_fifo_2__ETC___d16 =
	     wc_fifo_1$RDY_portA_request_put &&
	     wc_fifo_2$RDY_portA_request_put &&
	     wc_fifo_3$RDY_portA_request_put &&
	     wc_fifo_4$RDY_portA_request_put &&
	     wc_fifo_5$RDY_portA_request_put &&
	     wc_fifo_6$RDY_portA_request_put &&
	     wc_fifo_7$RDY_portA_request_put ;

