		 $unsigned(wc_fifo_2$portA_response_get),
		 $unsigned(wc_fifo_3$portA_response_get));
    if (RST_N != `BSV_RESET_VALUE)
      if (WILL_FIRE_RL_done) $display("TESTS FINISHED");
